  constructor(
    string memory _initBaseURI,
    uint _startDate
  ) ERC721("ToastPunks", "TP") {
    setBaseURI(_initBaseURI);

    startDate = _startDate;
  }

  function _beforeTokenTransfer(address from, address to, uint256 tokenId) override internal {
      super._beforeTokenTransfer(from, to, tokenId);
      owners[tokenId].push(to);
      owned[to]++;
  }

  // internal
  function _baseURI() internal view virtual override returns (string memory) {
    return baseURI;
  }

  function mintLast10() public onlyOwner {
    uint supply = totalSupply();
    require(totalSupply() == 990, "Public minting phase still underway");
    for (uint i = 1; i <= 10; i++) {
        _safeMint(msg.sender, supply+i);        
    }  
  }

  function getTokenOwners(uint _tokenId) public view returns(address[] memory) {
      return owners[_tokenId];
  }

  function claimAirdrop(uint _userId) public {
      require(distribute[_userId-1] == msg.sender, "You are not entitled to this token");
      _safeMint(msg.sender, _userId);
  }

  // public
  function mint(address _to, uint256 _mintAmount) public payable {
    uint256 supply = totalSupply();
    require(supply >= 100, "Army have not finished minting yet");
    require(block.timestamp >= startDate, "Minting has not started yet");
    require(!paused);
    require(_mintAmount > 0);
    require(minted[msg.sender] + _mintAmount <= maxMintAmount, "You have reached the max mint amount");
    require(supply + _mintAmount <= maxSupplyPublic, "Max public supply minted");

    uint tokensNextStage;
    uint tokensThisStage;
    if ((supply + _mintAmount) > supplyStages[stage]) {
        tokensNextStage = (supply + _mintAmount) - supplyStages[stage];
        tokensThisStage = supplyStages[stage] - supply;
        stage++;
    } else if ((supply + _mintAmount) == supplyStages[stage]) {
        stage++;
    }

    if (msg.sender != owner()) {
        if(whitelisted[msg.sender] != true) {
            if (tokensNextStage == 0 && tokensThisStage == 0) {
                require(msg.value >= ethPrices[stage] * _mintAmount, "In payment not enough"); 
                if (!(_mintAmount == maxMintAmount)) {
                  require(owned[msg.sender] >= requiredOwned[stage], "You don't have enough owned or previously owned to mint an NFT in this stage");
                }               

            } else {
                require(msg.value >= (ethPrices[stage-1] * tokensThisStage) + (ethPrices[stage] * tokensNextStage), "Bridge payment not enough");
                if (!(_mintAmount == maxMintAmount)) {
                  require(owned[msg.sender] >= requiredOwned[stage], "You don't have enough owned or previously owned to mint an NFT in this stage");
                }     
            }

        }
    }

    minted[msg.sender] += _mintAmount;

    for (uint256 i = 1; i <= _mintAmount; i++) {
      _safeMint(_to, supply + i);
    }
  }

  function walletOfOwner(address _owner)
    public
    view
    returns (uint256[] memory)
  {
    uint256 ownerTokenCount = balanceOf(_owner);
    uint256[] memory tokenIds = new uint256[](ownerTokenCount);
    for (uint256 i; i < ownerTokenCount; i++) {
      tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
    }
    return tokenIds;
  }

  function tokenURI(uint256 tokenId)
    public
    view
    virtual
    override
    returns (string memory)
  {
    require(
      _exists(tokenId),
      "ERC721Metadata: URI query for nonexistent token"
    );

    string memory currentBaseURI = _baseURI();
    return bytes(currentBaseURI).length > 0
        ? string(abi.encodePacked(currentBaseURI, tokenId.toString(), baseExtension))
        : "";
  }

  //only owner

  function setmaxMintAmount(uint256 _newmaxMintAmount) public onlyOwner() {
    maxMintAmount = _newmaxMintAmount;
  }

  function setBaseURI(string memory _newBaseURI) public onlyOwner {
    baseURI = _newBaseURI;
  }

  function setBaseExtension(string memory _newBaseExtension) public onlyOwner {
    baseExtension = _newBaseExtension;
  }

  function pause(bool _state) public onlyOwner {
    paused = _state;
  }

 function whitelistUser(address _user) public onlyOwner {
    whitelisted[_user] = true;
  }

  function removeWhitelistUser(address _user) public onlyOwner {
    whitelisted[_user] = false;
  }

  function setStartDate(uint _newDate) public onlyOwner {
      startDate = _newDate;
  }

  function withdraw() public payable onlyOwner {
    require(payable(msg.sender).send(address(this).balance));
  }
}
